from sympy import factorint
def sbd(n): return bin(n).count('1')
def ok(n):
  f = factorint(n)
  return sum(f[p] for p in f) > 1 and sbd(n) == sum(sbd(p)*f[p] for p in f)
print(list(filter(ok, range(1244)))) # _Michael S. Branicky_, Apr 22 2021

